import React from "react";
import Item from "./Item";

const Listado = (props) =>{
    return(
        <>
            {
                ()=>{
                    if(props.bandera === true)
                    {
                        return(
                            <ul>
                                {
                                    props.lista.map((item, index)=>{
                                        return <Item key={index} item={item} index={index}/>
                                    })
                                }
                                {Listado.indexHTML = ''}
                            </ul>
                        );
                    }
                }
            }
        </>
    );
}

export default Listado;
